import React, { useState } from "react";
import Heatmap from "react-calendar-heatmap";
import "react-calendar-heatmap/dist/styles.css";

function ProfilePage() {
  const [tab, setTab] = useState("about");

  function handleTabChange(newTab) {
    setTab(newTab);
  }

  return (
    <div>
      <nav>
        <ul>
          <li>
            <button
              className={tab === "about" ? "active" : ""}
              onClick={() => handleTabChange("about")}
            >
              About Me
            </button>
          </li>
          <li>
            <button
              className={tab === "heatmap" ? "active" : ""}
              onClick={() => handleTabChange("heatmap")}
            >
              Heatmap
            </button>
          </li>
        </ul>
      </nav>
      <div className="content">
        {tab === "about" && <AboutMe />}
        {tab === "heatmap" && <HeatmapComponent />}
      </div>
    </div>
  );
}

function AboutMe() {
  return (
    <div>
      <h1>About Me</h1>
      <p>Hi there! My name is [Your Name] and I'm a [Your Profession].</p>
      <p>I love working on [Your Area of Expertise] and creating [Your Passion Projects].</p>
    </div>
  );
}

function HeatmapComponent() {
  // Generate random data for heatmap
  const startDate = new Date("2023-01-01");
  const endDate = new Date("2023-12-31");
  const data = [];
  for (let i = 0; i < 100; i++) {
    data.push({
      date: new Date(startDate.getTime() + Math.random() * (endDate.getTime() - startDate.getTime())),
      count: Math.floor(Math.random() * 4),
    });
  }

  return (
    <div>
      <h1>Heatmap</h1>
      <Heatmap
        startDate={startDate}
        endDate={endDate}
        values={data}
        showWeekdayLabels={true}
        titleForValue={(value) => {
          if (!value) {
            return "No data";
          }
          return `${value.count} contributions on ${value.date.toISOString().slice(0, 10)}`;
        }}
      />
    </div>
  );
}

export default ProfilePage;
